import react from 'react'
import Emojidata from './Emojidata'
import Gameplay from './Gameplay'
let styleObj={
    width:"500px",
    height:"95px",
    backgroundColor: "rgba(209, 54, 54, 0.897)",
    boxShadow:  "2px 2px 29px black inset",
    padding:"30px 47px 25px",
    color:"White",
    textAlign:"center",
    paddingTop:"10px",
    marginTop:"60px"
}
const cngState=()=>{
    return(
        <>
        <Gameplay/>
        </>
    )
}
const Instructionpan=(props)=>{
return(
<>
<div style={styleObj}>
<h2 onClick={cngState}>{props.Iindex==0?"Click to select your Emoji...":`Your selected Emoji is ${Emojidata[props.Iindex]} and click "Next"`}</h2>
</div>
</>
)
}
export default Instructionpan
